const INITIAL_STATE = {
  name: '',
  email: '',
  cpf: '',
  address: '',
  city: '',
  uf: '',
};

const personalData = (state = INITIAL_STATE, action) => {
  switch (action.type) {
  default:
    return {
      ...state,
    };
  }
};

export default personalData;
